import React from 'react';
import { Link } from 'react-router-dom';

    
    function Header() {
        return (
            <header>
                <h1>EasyBook</h1>
                <nav>
                    <Link to="/api/register">Register</Link>
                    <Link to="/api/login">Login</Link>
                </nav>
            </header>
        );
    }


export default Header;
